  false,\n\t\"url\": null,\n\t\"notes\": \"This is a summary of the water needs of
  the Naval Air Station and the Lahontan Valley Wetlands area. Section 206(c) of Public
  Law 101-618, requires the Secretary of the Navy to undertake a study of water rights
  owned by the Naval Air Station, Fallon, to determine if water deliveries to that
  area can be safely reduced. Any water saving resulting from implementation of suggested
  efficiency management options, are to be used by the Secretary of the Interior for
  the benefit of fish and wildlife resources at both Pyramid Lake and the Lahontan
  Valley wetlands as referenced in the bill under sections 206 and 207.\",\n\t\"license_title\":
